import React from "react";
import {num} from './App'
const Body=(props)=>{
    return(
        <div className="divcomp">

            <num.Consumer>
                {
                    (val)=>{
                        return (<h3>this is {val.name}</h3>)
                    }
                }
            </num.Consumer>

        </div>
    )
}

export default Body;
